function printer(i = 0) {
  fetch(links[i])
    .then(res => res.text())
    .then(text => {
      const parser = new DOMParser();
      const docHTML = parser.parseFromString(text, 'text/html');
      docHTML.querySelector("h1").id = pegarID(links[i]);
      docHTML.querySelectorAll('img').forEach(img => {
        imagem(links[i], img);
      });
      docHTML.querySelectorAll('a').forEach(a=>{
        a.href = "#" + encodeURIComponent(pegarID(a.href));
      })
      document.querySelector("body").append(docHTML.querySelector("html"));
      i++;
      if (links[i] != undefined) {
        printer(i);
        console.log(i);
      } else {
        console.log("Ok!");
      }
    })
    .catch(err => {
      console.error(err);
    })
}

function imagem(caminho, img) {
  const dados = img.outerHTML.split("\"");
  const caminhoArr = caminho.split("/");
  caminhoArr.pop();
  for (let i = 0; i < img.outerHTML.split("\"").length; i++) {
    caminho = caminhoArr.join("/");
    if (dados[i].match(/..\//)) {
      img.src = caminho + "/" + dados[i];
    }
  }
}

function pegarID(ahref){
  return ahref.split("/").pop().split("?")[0];
}

